import React from 'react';
import './Css/table.css'
import axios from 'axios';
import ReactTable from "react-table";

export default class PersonList extends React.Component {
  state = {
    title: [],
    id: [],
    description: []
  }


  componentDidMount() {
    axios.get(`https://api.github.com/users/mikifriki/repos`)
      .then(rest => {
        const title = rest.data;
        const description = rest.data;
        const id = rest.data;
        this.setState({description})
        this.setState({ title });
      })



  }

  render() {
    return (

      <table>
      <thead>
        <th>Proj</th>
        <th>second</th>
      </thead>
        <tbody>
          <td>
            { this.state.title.map(title => <tr className="tat">{title.name}</tr>)}
          </td>
          <td className="tets">
            { this.state.title.map(description=> <tr>{description.description}</tr>)}
          </td>
          <td className="tets">
            { this.state.title.map(id> <tr>{id.id}</tr>)}
          </td>


        </tbody>
      </table>
    )
  }
}
